import React from "react"
import "./SupportedConversions.css"
import { conversionData } from "../../dummydata"
import Heading from "../common/heading/Heading"

const ConversionCard = ({ title, items }) => {
  return (
    <div className="conversion-card">
      <div className="content flex">
        <div className="left">
          <div className="img">
            <img src="/images/arrow.png" alt={title} />
          </div>
        </div>
        <div className="text">
          <h1>{title}</h1>
          <div className="items-list">
            {items.map((item, index) => (
              <div key={index} className="item">
                <i className="fas fa-exchange-alt"></i>
                <span>{item}</span>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  )
}

export default function SupportedConversions() {
  return (
    <>
      <section className="intro" id="intro">
        <div className="container">
          <h2>Introduction to Financial Message Conversions</h2>
          <p>In today's global financial landscape, seamless communication between different messaging standards is crucial. Our conversion solutions bridge the gap between various financial message formats, ensuring smooth international transactions and compliance with evolving standards.</p>
        </div>
      </section>

      <section className="how-it-works" id="how-it-works">
        <div className="container">
          <div className="step-content">
            <h2>How It Works</h2>
            <div className="steps">
              <div className="step">
                <div className="step-icon">Message Receipt</div>
              </div>
              <div className="step-connector">
                <img src="/images/arrowback.png" alt="connector" />
              </div>
              <div className="step">
                <div className="step-icon">Format Analysis</div>
              </div>
              <div className="step-connector">
                <img src="/images/arrowback.png" alt="connector" />
              </div>
              <div className="step">
                <div className="step-icon">Conversion Process</div>
              </div>
              <div className="step-connector">
                <img src="/images/arrowback.png" alt="connector" />
              </div>
              <div className="step">
                <div className="step-icon">Validation</div>
              </div>
              <div className="step-connector">
                <img src="/images/arrowback.png" alt="connector" />
              </div>
              <div className="step">
                <div className="step-icon">Delivery</div>
              </div>
            </div>
          </div>
        </div>
      </section>

      <section className="conversions-section padding" id="conversions">
        <Heading title="CONVERSIONS" subtitle="Supported Message Conversions" />
        <div className="container grid2">
          {Object.entries(conversionData).map(([key, value]) => (
            <ConversionCard key={key} title={key.replace('_', ' to ').toUpperCase()} items={value} />
          ))}
        </div>
      </section>

      <style jsx>{`
        section {
          border-bottom: 2px solid #2d67d3;
          padding-bottom: 40px;
          margin-bottom: 40px;
        }

        .intro {
          background: linear-gradient(135deg, #2d67d3, #4facff);
          color: #ffffff;
          text-align: center;
          padding: 80px 20px;
        }

        .intro h2 {
          font-size: 2.8em;
          font-weight: 700;
          margin-bottom: 20px;
        }

        .intro p {
          font-size: 1.1em;
          max-width: 750px;
          margin: 0 auto;
          line-height: 1.8;
          opacity: 0.9;
        }

        .how-it-works {
          padding: 100px 20px;
          text-align: center;
        }

        .how-it-works h2 {
          font-size: 2.5em;
          color: #2d67d3;
          font-weight: 700;
          margin-bottom: 60px;
          text-transform: uppercase;
        }

        .steps {
          display: flex;
          justify-content: center;
          align-items: center;
          gap: 20px;
        }

        .step {
          width: 120px;
          height: 120px;
          border-radius: 50%;
          background: radial-gradient(circle at top left, #2d67d3, #4facff);
          color: #ffffff;
          display: flex;
          align-items: center;
          justify-content: center;
          font-size: 1.2em;
          font-weight: 500;
          transition: transform 0.3s ease, box-shadow 0.3s ease;
        }

        .step:hover {
          transform: scale(1.1);
          box-shadow: 0 15px 20px rgba(0, 0, 0, 0.2);
        }

        .step-connector {
          width: 60px;
          height: 30px;
          display: flex;
          align-items: center;
        }

        .step-connector img {
          width: 100%;
          height: auto;
          object-fit: contain;
        }

        .conversions-section {
          text-align: center;
        }

        @media screen and (max-width: 768px) {
          .steps {
            flex-direction: column;
          }

          .step-connector {
            transform: rotate(90deg);
          }
        }
      `}</style>
    </>
  )
}
